column12:
Colon caecum, colon ascendens, transversum dan descendens, sigmoid, resection: Severe active chronic colitis with transmural inflammation and fissuring ulcer; 
--Dengan assesmen IBD: Lesi memenuhi 4  kriteria mayor (sebukan limfoplasmasitik transmukosal, distorsi kripta, atrophy kripta dan permukaan irreguler) dan 1 kriteria minor (agregat lymphoid) sehingga masuk kategori "most lkely IBD"; histopatology dapat mendukung diagnosis klinis Chron's disease. 

Appendix, appendectomy:Chronic appendicitis
